import React from 'react';
import './HomePage.css';

function HomePage() {
  return (
    <div className="home-container">
      
      <section className="home-section">
        <h2>Про нас</h2>
        <p>
          Ми створили цей сайт для того, щоб допомогти людям зрозуміти важливість здорового способу життя,
          навчитися правильно харчуватися та відслідковувати кількість спожитих та витрачених калорій, підтримувати водний баланс, вибирати ефективні дієти та бути активними.
        </p>
      </section>

      <section className="home-section images-section">
        <div className="image-gallery">
          <img src="/images/healthy_food.jpg" alt="Здорове харчування" />
          <img src="/images/sport_activity.jpg" alt="Фізична активність" />
          <img src="/images/water_balance.jpg" alt="Водний баланс" />
        </div>
      </section>

    </div>
  );
}

export default HomePage;
